import React from 'react';
import { Image, Grid, Feed, Icon, Card, Header } from 'semantic-ui-react';

const _HeaderMovieCast = props => {

    return (
        <React.Fragment>
            <Grid>
                <Grid.Column>
                    <Image onClick={() => props.movieDetials(props.movie.id)} src={props.movieImage} className="sizeOfNewSearchMovieForTop5" />
                </Grid.Column>
            </Grid>
        </React.Fragment >
    )
}

export default _HeaderMovieCast;
